import React from 'react';
import  GrFilter from 'react-icons/Gr/index';

function Home() {

  return (
    <div >
      <div><div><span><GrFilter/></span>Filter</div></div>
      <div className='home' style={{color:"black"}}>
      <h1>Home</h1>
      </div>
    </div>
  );
}

export default Home;
